import React from 'react';
import Styles from './Setting.module.css'
import { useEffect,useState } from 'react';
import axios from 'axios';

const Setting = () => {
    const [data, setData] = useState([]);
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [uname, setUname] = useState('');
    const [uemail, setUemail] = useState('');
    const [editID, setEditID] = useState(-1);
    const [editEmail, setEditEmail] = useState();
    const [editName, setEditName] = useState();
    useEffect(() => {
        axios.get("https://dashboard-3frk.onrender.com/loginData")
            .then(res => {
                console.log(res.data);
                setData(res.data);

            })
    }, []);
    return (
        <section id={Styles.apartment_dashboard}>
            <ul>
                <li className={Styles.li}>
                    <a href="#" className={Styles.apartment_tab}>
                        Apartments Dashboard
                    </a>
                </li >
                <li className={Styles.li}>
                    <a href="#" className={Styles.content_tab}>
                        Content
                    </a>
                </li>
                <li className={Styles.li}>
                    <a href="#" className={Styles.users_tab}>
                        Users
                    </a>
                </li>
            </ul>
            <h3 id={Styles.page_description}>Apartments List</h3>

            <table>
                <thead>
                    <tr>
                        <th className={Styles.apartment_cell}>ID</th>
                        <th className={Styles.owner_cell}>User Name</th>
                        <th className={Styles.address_cell}>Password</th>
                    </tr>
                </thead>
                <tbody >
                    {
                        data.map(user => (
                            // user.id === editID ?
                            // <tr key={user.id}>
                            //     <td>{user.id}</td>

                            //     {/* <td>{user.name}</td> */}
                            //     <td><input type="text"   value={uname} onChange={e =>(setUname(e.target.value))}/></td>

                            //     <td><input type="text"  value={uemail} onChange={e =>(setUemail(e.target.value))}/></td>

                            //     <td><button type="button" onClick={handleUpdate}>Update</button></td>

                            // </tr>
                            // :
                            user.id === editID && user.name === editName ?
                                <tr key={user.id}>
                                    <td>{user.id}</td>

                                    <td><input type="text" value={uname} onChange={e => (setUname(e.target.value))} /></td>
                                    <td>{user.username}</td>

                                    {/* <td><input type="text" value={uemail} onChange={e => (setUemail(e.target.value))} /></td> */}

                                    <td><button type="button" className='btn btn-success' onClick={handleUpdate}>Update</button></td>

                                </tr>
                                : user.id === editID && user.email === editEmail ?
                                    <tr key={user.id}>
                                        <td>{user.id}</td>

                                        <td>{user.username}</td>

                                        <td><input type="text" value={uemail} onChange={e => (setUemail(e.target.value))} /></td>

                                        <td><button type="button" className='btn btn-success' onClick={handleUpdate}>Update</button></td>

                                    </tr>
                                    : user.id === editID ?
                                        <tr key={user.id}>
                                            <td>{user.id}</td>

                                            <td><input type={user.text} value={uname} onChange={e => (setUname(e.target.value))} /></td>

                                            <td><input type="text" value={uemail} onChange={e => (setUemail(e.target.value))} /></td>

                                            <td><button type="button" className='btn btn-success' onClick={handleUpdate}>Update</button></td>

                                        </tr>
                                        :
                                        <tr key={user.id}>
                                            <td>{user.id}</td>
                                            <td onClick={() => handleEditUserName(user.id, user.name)}>{user.name}</td>
                                            <td onClick={() => handleEditUserEmail(user.id, user.email)}>{user.email}</td>
                                            <td>
                                                <button className='btn btn-primary mx-2' type="button" onClick={() => handleEdit(user.id)}>Edit</button>
                                                <button className='btn btn-danger' type="button" onClick={() => handleDelete(user.id)}>Delete</button>
                                            </td>
                                        </tr>
                        ))
                    }
                </tbody>
            </table>

        </section>

    );
}

export default Setting;
